import {createBrowserRouter} from "react-router-dom";
import Root from "../root";
import Contacts from "../views/Contacts";
import React from "react";

export const router = createBrowserRouter([
    {
        path: "/",
        element: <Root />,
    },
    {
        path: "/contacts",
        element: <Contacts />,
    },

]);
